(100, 'إعداد خطة للقوى العاملة', NULL, 3, 14, '2020-07-14', NULL, 'أولا:  كيفية إعداد خطة للقوى العاملة بمصنع الاسمنت بمدينة بنى سويف الجديدة بمحافظة بنى سويف كأحد سياسات إدارة الموارد البشرية\n1- مقدمة: عن مبادئ ومفاهيم إدارة الموارد البشرية.\n2- العوامل التي تؤثر على سياسة تخطيط القوى العاملة وأهم تحدياتها فى مصنع الاسمنت.\n3- محتوى البحث:\n-	مفهوم وأهمية تخطيط القوى العاملة فى مصنع الاسمنت.\n-	المراحل التفصيلية لتخطيط القوى العاملة فى مصنع الاسمنت.\n-	المصادر التى يمكن الاعتماد عليها لتوفير العمالة المطلوبة للمصنع.\n-	أنواع المقابلات التى يمكن الاعتماد عليها لاختيار اكفأ العمالة المطلوبة للمصنع\n4- المراجع:  التى تم الاعتماد عليها فى اعداد البحث.', '2020-06-03 13:56:48', '2020-07-15 19:14:04', NULL, 1),
(101, 'إعداد تحليل وتوصيف للوظائف', NULL, 3, 14, '2020-07-14', NULL, 'ثانيا: كيفية إعداد تحليل وتوصيف للوظائف بمصنع الاسمنت بمدينة بنى سويف الجديدة بمحافظة بنى سويف كأحد سياسات إدارة الموارد البشرية\n1- مقدمة: عن مبادئ ومفاهيم إدارة الموارد البشرية.\n2- العوامل التي تؤثر سياسة تحليل وتوصيف للوظائف فى مصنع الاسمنت.\n3- محتوى البحث:\n-	مفهوم وأهمية تحليل وتوصيف للوظائف .\n-	المعلومات الأساسية اللازمة لتحليل الوظائف بالمصنع.\n-	طرق جمع المعلومات الأساسية اللازمة لتحليل الوظائف بالمصنع \n-	المراحل التفصيلية لتحليل وتوصيف للوظائف فى مصنع الاسمنت.\n4- المراجع:  التى تم الاعتماد عليها فى اعداد البحث', '2020-06-03 13:57:27', '2020-07-15 19:14:04', NULL, 1),
(102, 'إعداد سياسة للاختيار والتعيين', NULL, 3, 14, '2020-07-14', NULL, 'ثالثا: كيفية إعداد سياسة للاختيار والتعيين بمصنع الاسمنت بمدينة بنى سويف الجديدة بمحافظة بني سويف كأحد سياسات إدارة الموارد البشرية\n1- مقدمة: عن مبادئ ومفاهيم إدارة الموارد البشرية.\n2- العوامل التي تؤثر على سياسة الاختيار والتعيين فى مصنع الاسمنت.\n3- محتوى البحث:\n-	مفهوم وأهمية سياسة الاختيار والتعيين فى مصنع الاسمنت.\n-	المصادر التي يمكن الاعتماد عليها فى اختيار وتوفير العمالة المطلوبة فى مصنع الاسمنت.\n-	الاختبارات التفصيلية التى يتم اجرائها للمرشحين لشغل الوظائف فى مصنع الاسمنت.\n-	أنواع المقابلات التى يمكن الاعتماد عليها لاختيار اكفأ العمالة المطلوبة للمصنع\n4- المراجع:  التى تم الاعتماد عليها فى اعداد البحث.', '2020-06-03 13:58:24', '2020-07-15 19:14:04', NULL, 1),
